script: |
  super -f tsv -I q9323.sql | sort > q9323.out

inputs:
  - name: q9323.sql
    data: |
      SELECT + cor0.col2 + + ( - NULLIF ( - cor0.col2, cor0.col2 ) + + 75 * cor0.col2 ) AS col2 FROM tab1 AS cor0 GROUP BY cor0.col2;
  - name: tab1

outputs:
  - name: q9323.out
    data: |
      3465
      5467
      616
